Expand description

A struct to help with [`fmt::Debug`](trait.Debug.html "trait std::fmt::Debug") implementations.

This is useful when you wish to output a formatted map as a part of your [`Debug::fmt`](about:blank/trait.Debug.html#tymethod.fmt "method std::fmt::Debug::fmt") implementation.

This can be constructed by the [`Formatter::debug_map`](about:blank/struct.Formatter.html#method.debug_map "method std::fmt::Formatter::debug_map") method.

## [Â§](#examples)Examples

```
use std::fmt;

struct Foo(Vec<(String, i32)>);

impl fmt::Debug for Foo {
    fn fmt(&self, fmt: &mut fmt::Formatter<'_>) -> fmt::Result {
        fmt.debug_map().entries(self.0.iter().map(|&(ref k, ref v)| (k, v))).finish()
    }
}

assert_eq!(
    format!("{:?}", Foo(vec![("A".to_string(), 10), ("B".to_string(), 11)])),
    "{\"A\": 10, \"B\": 11}",
);
```

